(function(){$("#TodoItemAddButton").click(function(n){n.preventDefault();$.ajax({url:"/Todos",type:"POST",contentType:"application/json",data:JSON.stringify($("#TodoCreateForm").serializeFormToObject())}).then(function(n){$("#TodoList").append(n);$("#TodoItemText").val("")})});$("#TodoList").on("click",".todo-item-delete-link",function(n){n.preventDefault();var t=$(this).closest("li");$.ajax({url:"/Todos/"+t.attr("data-id"),type:"DELETE"}).then(function(){t.remove()})})})();